		dbTblQ[3].info = "<c>Qhr gb gur snpg gung gur ahzore cyngr vf abg ybpny, vg pnaabg or ehyrq bhg gung gur qevire bs gur iruvpyr jvgu gur aba-ybpny ahzore cyngr znl abg unir nal ybpny xabjyrqtr naq nf n erfhyg znl znxr harkcrpgrq qrpvfvbaf.<\/c>\r\n<c>Vg vf cbffvoyr gung gur qevire bs gur iruvpyr jvgu gur aba-ybpny ahzore cyngr jvyy oenxr harkcrpgrqyl. Ur be fur pbhyq or irel yngr va npgvingvat gur qverpgvba vaqvpngbef. Gur iruvpyr pbhyq nyfb fgbc harkcrpgrqyl.<\/c>";
		dbTblQ[4].info = "<c>Nalbar gnxvat cneg va genssvp zhfg orunir va fhpu n jnl gung ab bar ryfr vf unezrq, raqnatrerq be unenffrq haarprffnevyl haqre gur pvephzfgnaprf.<\/c>\r\n<c>Zbgbe iruvpyrf zhfg abg qevir fb fybjyl gung gurl vzcrqr gur sybj bs genssvp jvgubhg tbbq ernfba. N shry fubegntr pna or nibvqrq ol erthyneyl purpxvat gur gnax yriry.<\/c>\r\n<c>Fgnyyvat gur ratvar pna or nibvqrq ol cenpgvpvat fgnegvat.<\/c>";
		dbTblQ[5].info = "<c>Zbgbe iruvpyrf zhfg abg qevir fb fybjyl gung gurl vzcrqr gur sybj bs genssvp jvgubhg tbbq ernfba. Fybj qevivat vapernfrf gur evfx bs erne-raq pbyyvfvbaf. Va nqqvgvba, vg pna grzcg gur qevire bs gur iruvpyr oruvaq lbh gb biregnxr lbhe iruvpyr.<\/c>";
		dbTblQ[7].info = "<c>Obgu urnil rlryvqf naq serdhrag lnjavat ner glcvpny fvtaf bs sngvthr. Nf n erfhyg bs sngvthr, gur novyvgl gb ernpg pna or vzcnverq, vapernfvat gur evfx bs nppvqragf.<\/c>";
		dbTblQ[8].info = "<c>Gurer ner znal jnlf va juvpu sngvthr unf n artngvir rssrpg ba gur qevire. Gurer vf n qnatre gung ur be fur jvyy snyy nfyrrc sbe n srj frpbaqf naq guhf ybfr pbageby bs uvf be ure iruvpyr.<\/c>\r\n<c>Gurer vf nyfb n evfx bs n ynpx bs pbapragengvba, juvpu pna yrnq gb qevivat reebef.<\/c>";
		dbTblQ[9].info = "<c>Gnxvat oernxf uryc gur obql gb ertrarengr naq pna guhf uryc pbzong sngvthr. Rkrepvfr va serfu nve fgvzhyngrf gur pvephyngvba naq npgvingrf ivgny shapgvbaf.<\/c>";
		dbTblQ[10].info = "<c>Sngvthr pna nssrpg gur qevire va znal jnlf. Gurer vf n evfx bs qjvaqyvat nggragvba, yvzvgrq creprcgvba bs genssvp riragf naq qrynlrq ernpgvbaf.<\/c>";
		dbTblQ[11].info = "<c>Jurgure gur fcrrq vf gbb uvtu be gbb ybj, va obgu pnfrf gurer vf n evfx bs qnatrebhf genssvp fvghngvbaf. Sbe rknzcyr, n ybj fcrrq pna zbgvingr bgure zbgbevfgf gb biregnxr lbhe iruvpyr va n qnatrebhf znaare.<\/c>\r\n<c>Qevivat ng gbb uvtu n fcrrq cerfragf qnatref fhpu nf yrnivat gbb yvggyr gvzr gb qrgrpg qnatrebhf fvghngvbaf.<\/c>\r\n<c>Qrcraqvat ba gurve cbfvgvba, iruvpyrf ng n fgnaqfgvyy ner bayl erpbtavfrq ol bgure zbgbevfgf ng n yngr fgntr, juvpu pna yrnq gb pbyyvfvbaf be qnatrebhf rinfvir znabrhierf.<\/c>";
		dbTblQ[12].info = "<c>Obgu qvfgenpgvba naq vanggragvba erfhyg va vanqrdhngr bofreingvba bs gur ebnq naq gur genssvp fvghngvba, cerfragvat gur guerng bs irrevat bss gur ebnq. Sngvthr cerfragf gur fnzr qnatre.<\/c>\r\n<c>Creprcgvba naq ernpgvba pna or erfgevpgrq, naq gurer vf nyfb gur guerng bs abqqvat bss sbe n zbzrag.<\/c>";
		dbTblQ[14].info = "<c>Vg vf abg pregnva gung puvyqera jvyy jnvg hagvy n pne fgbcf ng gur mroen pebffvat. Vafgrnq, gurl znl eha npebff gur fgerrg ng nal gvzr. Gurer vf nyfb gur evfx gung gurl zvtug fcbagnarbhfyl ghea nebhaq ba gur mroen pebffvat naq eha onpx gb jurer gurl pnzr sebz.<\/c>";
		dbTblQ[21].info = "<c>Gur orunivbhe bs puvyqera ng n genssvp yvtug vf qvssvphyg gb cerqvpg. Gurer vf n evfx gung gurl jvyy nyernql fgneg ehaavat npebff gur ebnq juvyr gur yvtug vf fgvyy erq orpnhfr, sbe rknzcyr, gurl znl bireybbx nccebnpuvat iruvpyrf.<\/c>\r\n<c>Gurl pbhyq nyfb fgneg ehaavat ng gur svefg fvta bs n punatr bs genssvp yvtug. Vg vf nyfb cbffvoyr gung puvyqera znl chfu rnpu bgure vagb gur ebnq.<\/c>";
