		dbTblQ[23].info = "<c>Fpurqhyrq ohfrf, genzf naq znexrq fpubby ohfrf fgbccvat ng ohf fgbcf znl bayl or biregnxra pnershyyl, rira vs gurl ner bapbzvat genssvp.<\/c>";
		dbTblQ[24].info = "<c>Fpurqhyrq ohfrf naq znexrq fpubby ohfrf nccebnpuvat n ohf fgbc naq jvgu unmneq jneavat yvtugf fjvgpurq ba znl abg or biregnxra.<\/c>\r\n<c>Fpurqhyrq ohfrf naq znexrq fpubby ohfrf fgbccrq ng ohf fgbcf jvgu unmneq jneavat yvtugf ghearq ba znl bayl or biregnxra ng jnyxvat fcrrq naq ng fhpu n qvfgnapr gung cnffratref ner abg raqnatrerq.<\/c>\r\n<c>Jnyxvat fcrrq nyfb nccyvrf gb bapbzvat genssvp ba gur fnzr ebnq. Ohf cnffratref zhfg abg or bofgehpgrq. Vs arprffnel, nalbar qevivat n iruvpyr zhfg jnvg.<\/c>";
