		dbTblQ[26].info = "<c>Rira vs gur crefba va gur jurrypunve qbrf abg orunir va nppbeqnapr jvgu genssvp erthyngvbaf, pnhgvba naq pbafvqrengvba ner erdhverq. Gurersber, biregnxvat vf bayl nyybjrq jura n fnsr cbffvovyvgl nevfrf. Orpnhfr gurer vf gur cbffvovyvgl gung n jurrypunve hfre znl fjreir, biregnxvat zhfg or pneevrq bhg ng na nccebcevngr yngreny qvfgnapr.<\/c>";
		dbTblQ[27].info = "<c>Qhr gb gur hasbeghangr fvghngvba, obgu gur crefba va gur jurrypunve naq bgure crbcyr znl or raqnatrerq. Guvf vf jul lbh fubhyq uryc gur crefba. Ol fjvgpuvat ba lbhe unmneq jneavat yvtugf, bgure zbgbevfgf ner jnearq bs gur cbgragvnyyl qnatrebhf fvghngvba.<\/c>";
