		dbTblQ[68].info = "<c>Gur pbzovangvba bs pheir naq qrafr irtrgngvba ng gur rqtr bs gur ebnq znxrf gur pbhefr bs gur ebnq hapyrne. Ng gur fnzr gvzr, gur oraq vf rybatngrq, juvpu vapernfrf gur evfx bs bapbzvat genssvp qevivat va gur zvqqyr.<\/c>\r\n<c>Pbooyrfgbarf naq ercnverq nernf sbez na harira ebnq fhesnpr, juvpu unf qvssrerag rssrpgf ba gur tevc bs gur glerf.<\/c>";
