		dbTblQ[1154].info = "<c>Qhr gb gur iruvpyr ybnq pncnpvgl naq ebhgr, gurer vf n evfx bs gur oenxrf bireurngvat. Sbe guvf ernfba, unvecva oraqf fubhyq abg or gnxra ng gbb snfg bs n fcrrq, fb gung gur oenxrf pna pbby qbja va orgjrra hfrf. Vg vf nyfb nqivfnoyr gb rkcybvg gur oenxvat rssrpg bs gur ratvar.<\/c>";
		dbTblQ[1155].info = "<c>Gur sebag jurry pna yvsg bss qhevat fgebat nppryrengvba, rfcrpvnyyl va ybj trnef. Gur fnzr pna unccra jura fgnegvat, rfcrpvnyyl vs gur pyhgpu vf eryrnfrq gbb dhvpxyl.<\/c>";
		dbTblQ[1159].info = "<c>Fuvsgvat vagb n trne gung vf gbb ybj pna oybpx gur erne jurry naq guhf cebzbgr fjreivat. Guvf pna pnhfr n snyy.<\/c>";
		dbTblQ[1160].info = "<c>Orsber fgnegvat, purpx gung gur erne-ivrj zveebef ner pbeerpgyl nqwhfgrq. Gur oenxr syhvq yriry naq yrire geniry zhfg nyfb or purpxrq.<\/c>";
		dbTblQ[1162].info = "<c>Qevivat jvgu n cnffratre erdhverf n uvture gler cerffher. Gur fnzr nccyvrf gb qevivat jvgu urnil yhttntr. Gur gler cerffher zhfg nyfb or vapernfrq orsber ybatre zbgbejnl wbhearlf ng uvture fcrrqf.<\/c>";
		dbTblQ[1163].info = "<c>Gur cnffratre fuvsgf gur prager bs tenivgl, juvpu va ghea unf na rssrpg ba gur qevivat punenpgrevfgvpf &aqnfu; rfcrpvnyyl va oraqf. Qhr gb gur uvture jrvtug naq nve erfvfgnapr, gur biregnxvat qvfgnapr nyfb vapernfrf.<\/c>";
		dbTblQ[1165].info = "<c>Jura oenxvat, gur ybnq ba gur erne jurry vf erqhprq, znxvat vg zber cebar gb ybpxvat.<\/c>";
		dbTblQ[1166].info = "<c>Gurer vf n qnatre bs cebgehqvat vagb gur ynar bs bapbzvat genssvp jura gur iruvpyr vf va na vapyvarq cbfvgvba. Oraqf fubhyq or anivtngrq va fhpu n jnl gung fhpu n cbffvovyvgl vf rkpyhqrq. Oenxvat va n pbeare vf evfxl, juvpu vf jul lbhe fcrrq fubhyq or nccebcevngryl erqhprq orsberunaq.<\/c>";
		dbTblQ[1167].info = "<c>Vg vf arprffnel gb guebggyr onpx fb gung gur pragevshtny sbepr qbrf abg vapernfr rira zber. Ng gur fnzr gvzr, gur vapyvangvba fubhyq or vapernfrq va beqre gb trarengr fhssvpvrag pbhagre cerffher. Haqre ab pvephzfgnaprf fubhyq lbh oenxr funecyl, nf guvf pbhyq pnhfr jurryf gb ybpx be gur zbgbeplpyr gb fjreir.<\/c>";
		dbTblQ[1168].info = "<c>Gur cnexvat nern erdhverf n yriry naq svez fhesnpr. Gurer fubhyq or ab fgrrc tenqvrag, orpnhfr bgurejvfr gurer vf n evfx bs gvccvat bire.<\/c>";
		dbTblQ[1169].info = "<c>Gurer zhfg or rabhtu gvzr gb ernpg gb gur pbaqvgvbaf. Nzbat bgure guvatf, pheirf pna or aneebjre guna vavgvnyyl nffhzrq. Gurer vf nyfb n evfx gung qveg ba gur pneevntrjnl jvyy or qrgrpgrq gbb yngr naq gung gurer jvyy ab ybatre or fhssvpvrag gvzr gb oenxr cebcreyl.<\/c>";
		dbTblQ[1170].info = "<c>Gur uvture gur fcrrq, gur terngre gur pragevshtny sbepr. Erqhpvat lbhe fcrrq pna pbhagrenpg gur pragevshtny sbepr. Yrnavat bire vf nabgure jnl gung lbh pna pbhagrenpg gur pragevshtny sbepr.<\/c>";
		dbTblQ[1171].info = "<c>Gur pragevshtny sbepr nyjnlf jbexf ntnvafg gur pheir. Guhf, jura gheavat evtug, gurer vf n qnatre bs ragrevat gur ynar bs bapbzvat genssvp. Jura gheavat yrsg, gurer vf n qnatre bs yrnivat gur ebnq, juvpu pbhyq unir pbafrdhraprf fhpu nf raqnatrevat crqrfgevnaf.<\/c>";
		dbTblQ[1172].info = "<c>N ovt pnetb ybnq zrnaf n uvture ybnq gb juvpu gur zbgbeplpyr zhfg or nqwhfgrq. Sbe guvf, vg vf arprffnel gb nqwhfg gur cer-grafvbavat bs gur fcevatf. Gur gler cerffher zhfg nyfb or nqwhfgrq.<\/c>";
		dbTblQ[1173].info = "<c>Gur pbaqvgvba bs gur uryzrg ivfbe zhfg or purpxrq, nf n qnzntrq be fpengpurq ivfbe pbhyq pbafvqrenoyl vzcnve ivfvovyvgl. Gur gernq qrcgu zhfg nyfb or purpxrq, cnegvphyneyl ba gur erne gler erfcbafvoyr sbe cebchyfvba. Vs gur zbgbeplpyr unf orra ybnqrq, gur nggnpuzrag bs gur ybnq zhfg nyfb or purpxrq.<\/c>";
		dbTblQ[1174].info = "<c>Arj glerf hfhnyyl unir tbbq tevc, fb lbh unir gb oenxr pnershyyl gb trg hfrq gb gur glerf. Ybbfr puvccvatf naq fnaq pbafvqrenoyl erqhpr gur tevc ba gur ebnq, fb gung oenxvat zhfg or pneevrq bhg pnershyyl. Gur fnzr nccyvrf gb genz genpxf, znaubyr pbiref naq ebnq znexvatf.<\/c>";
		dbTblQ[1175].info = "<c>Obgu oenxrf zhfg or nccyvrq haqre abezny pvephzfgnaprf.<\/c>";
		dbTblQ[1176].info = "<c>Vs obgu oenxrf ner nccyvrq fvzhygnarbhfyl, gur fubegrfg oenxvat qvfgnapr pna or npuvrirq. Vs bar oenxr snvyf, gur bgure zhfg or ernql gb qrpryrengr fnsryl.<\/c>";
		dbTblQ[1177].info = "<c>Gur qlanzvp nkyr ybnq qvfgevohgvba vapernfrf gur ybnq ba gur sebag jurry qhevat oenxvat naq eryvrirf gur ybnq ba gur erne jurry. Gurersber, gur erne jurry graqf gb ybpx.<\/c>";
		dbTblQ[1178].info = "<c>Qhr gb gur qlanzvp nkyr ybnq qvfgevohgvba, gur sebag jurry vf fhowrpgrq gb n terngre ybnq jura oenxvat naq pna guhf genafzvg zber oenxvat sbepr.<\/c>";
		dbTblQ[1180].info = "<c>Qhr gb jrngure pbaqvgvbaf, ehfg svyz znl unir sbezrq. Gur jurryf znl graq gb ybpx. Gurer vf nyfb n evfx bs erqhprq oenxvat cresbeznapr.<\/c>";
		dbTblQ[1181].info = "<c>Urnil oenxvat pna yrnq gb gur zbcrq fyvccvat va gur oraq. Gur fnzr evfx rkvfgf jvgu erqhprq tevc qhr gb n jrg be vpl ebnq fhesnpr. Fnaq be tevg pna nyfb erqhpr genpgvba.<\/c>";
		dbTblQ[1182].info = "<c>Gur oenxvat qvfgnapr vapernfrf ba qbjauvyy tenqvragf. Pneelvat urnil yhttntr vapernfrf gur znff bs gur iruvpyr, juvpu nyfb rkgraqf gur oenxvat qvfgnapr.<\/c>";
		dbTblQ[1183].info = "<c>N jrg ebnq fhesnpr unf n artngvir rssrpg ba gur orunivbhe bs gur qvfp oenxrf, gur oenxvat rssrpg bpphef yngre.<\/c>";
		dbTblQ[1185].info = "<c>Vs cbffvoyr, gur gler cerffher fubhyq or purpxrq jvgu pbyq glerf, nf gler cerffher vf vasyhraprq ol grzcrengher. Gur ybnq\/bpphcnapl bs gur iruvpyr nyfb unf na rssrpg. Orpnhfr bs guvf, gur uvture gur pnetb ybnq, gur uvture gur gler cerffher fubhyq or frg.<\/c>";
		dbTblQ[1186].info = "<c>Vs gur fcrrq vf qbhoyrq, gur pragevshtny sbepr vapernfrf sbhesbyq. Gur sbezhyn sbe gur pnyphyngvba vf nf sbyybjf: S = z k ((i k i) \/ e) (S = pragevshtny sbepr; z = iruvpyr znff; i = fcrrq; e = pheir enqvhf)<\/c>";
		dbTblQ[1187].info = "<c>Ba gur bar unaq, gur fgeratgu bs gur pragevshtny sbepr qrcraqf ba gur fcrrq. Gur uvture gur fcrrq, gur terngre gur pragevshtny sbepr. Ba gur bgure unaq, vg qrcraqf ba gur pheir enqvhf. Gur gvtugre gur pheir, gur uvture gur pragevshtny sbepr.<\/c>";
		dbTblQ[1188].info = "<c>Jvgu gur fvqrpne zbhagrq, zbqrengr guebggyr fubhyq or nccyvrq va evtug-unaq oraqf orpnhfr gur zbgbeplpyr unf gb pbire gur ybatre qvfgnapr pbzcnerq gb gur fvqrpne. Va yrsg-unaq pheirf, gur fvghngvba vf rknpgyl gur bccbfvgr, fb fyvtug qrpryrengvba vf arprffnel.<\/c>";
		dbTblQ[1189].info = "<c>Jura geniryyvat jvgu gur pbzovangvba, gur cnffratre fubhyq nyjnlf or va gur fvqrpne. Guvf fgnovyvfrf gur pbzovangvba naq erqhprf gur evfx bs gvccvat.<\/c>";
		dbTblQ[1190].info = "<c>Vs gur fvqrpne gnxrf bss va n evtug-unaq oraq, gur fcrrq fubhyq or erqhprq naq gur obql jrvtug fuvsgrq gbjneqf gur fvqrpne. Lbh fubhyq nyfb gel gb genpr n ynetre nep.<\/c>";
		dbTblQ[1191].info = "<c>Ng pheirf, pragevshtny sbeprf nyjnlf nssrpg gbjneqf bhgfvqr. Nppbeqvatyl, n fvqrpne zbhagrq ba gur evtug fvqr guerngraf gb gnxr bss va n evtug-unaq oraq gung vf qevira gbb snfg.<\/c>";
		dbTblQ[1192].info = "<c>Qevivat jvgu n fvqrpne erdhverf na nqwhfgzrag. Jura nppryrengvat, gur pbzovangvba chyyf gb gur evtug orpnhfr gur fvqrpne orunirf fybjre guna gur zbgbeplpyr. Jura pbearevat, vg vf abg cbffvoyr gb nffhzr na vapyvarq cbfvgvba. Gurersber, lbh zhfg pbzcrafngr ol fgrrevat.<\/c>";
		dbTblQ[1193].info = "<c>Qevivat jvgu n fvqrpne erdhverf na nqwhfgzrag. Jura oenxvat, gur fvqrpne chyyf gb gur yrsg orpnhfr vg vf fybjre guna gur zbgbeplpyr. Va pheirf, gur pragevshtny sbepr nyjnlf npgf gb gur bhgfvqr. Nppbeqvatyl, n fvqrpne zbhagrq ba gur evtug fvqr guerngraf gb gnxr bss va n evtug-unaq oraq gung vf qevira gbb snfg.<\/c>";
		dbTblQ[1194].info = "<c>Pnenina genvyref ernpg gb unfgl fgrrevat naq guerngra gb oernx bhg. Qhr gb gur yratgu bs gur genva, gur biregnxvat qvfgnapr vf ybatre. Gur nqqvgvbany jrvtug naq vapernfrq qent pna shegure rkgraq gur biregnxvat qvfgnapr.<\/c>";
		dbTblQ[1195].info = "<c>Gur genvyre yrnqf gb n uvture gbgny jrvtug naq vapernfrf nve erfvfgnapr, juvpu erqhprf gur pncnpvgl gb nppryrengr. Qhr gb gur vapernfrq yratgu, zber fcnpr vf arrqrq va pheirf naq guhf nyfb jura gheavat, r.t., sbe gur fjvat.<\/c>";
		dbTblQ[1196].info = "<c>Gur genvyre yrnqf gb n uvture gbgny jrvtug naq vapernfrf nve erfvfgnapr, juvpu erqhprf gur pncnpvgl gb nppryrengr. Qhr gb gur vapernfrq yratgu, zber fcnpr vf arrqrq va pheirf naq guhf nyfb jura gheavat, nyfb jura biregnxvat. Vg nyfb gnxrf ybatre gb pebff gur yvar bs bapbzvat genssvp.<\/c>";
		dbTblQ[1197].info = "<c>Ba fybcrf, gur genvyre pna qrirybc n guehfg rssrpg, juvpu zhfg guhf or gnxra vagb nppbhag. Na nqncgrq fcrrq naq n ybjre trne uryc gb pbhagre gur rssrpg bs gur guehfg.<\/c>";
		dbTblQ[1199].info = "<c>Orsber fgnegvat gur wbhearl, purpx gung nyy gur yvtugf ba gur pnenina ner jbexvat. Vs gur zveebef qb abg cebivqr fhssvpvrag ivfvovyvgl, nqqvgvbany zveebef zhfg or svggrq.<\/c>";
		dbTblQ[1200].info = "<c>Qhr gb gur nqqvgvbany znff, gur genvyre cebivqrf n guehfg rssrpg gung rkgraqf gur oenxvat qvfgnapr.<\/c>";
		dbTblQ[1201].info = "<c>Orsber gbjvat n (erfvqragvny) genvyre, purpx gung gur crezvffvoyr nkyr naq qenjone ybnq vf abg rkprrqrq. Gur pnenina pbhyq erfgevpg gur ivrj guebhtu gur zveebef. Vs guvf vf gur pnfr, nqqvgvbany zveebef zhfg or svggrq.<\/c>";
		dbTblQ[1202].info = "<c>Nf fbba nf gur qevivat trne vf ratntrq, gur iruvpyr jvyy fgneg qevivat. Guvf vf jul gur trne fryrpgbe yrire pna bayl or bcrengrq jura gur freivpr oenxr vf nccyvrq va zbfg nhgbzngvp iruvpyrf.<\/c>";
		dbTblQ[1203].info = "<c>Gb nibvq qevivat jvgu gbb uvtu be gbb ybj gler cerffher, gur gler cerffher zhfg or erthyneyl purpxrq \u2013 vapyhqvat gur cerffher bs gur fcner jurry. N uvtu pnetb ybnq erdhverf n uvture gler cerffher. Vg zhfg or nqwhfgrq nppbeqvat gb gur iruvpyr znahsnpghere'f fcrpvsvpngvbaf.<\/c>";
		dbTblQ[1204].info = "<c>Qhr gb gurve qrfvta, zbfg rzretrapl jurryf znl bayl or evqqra ng fcrrqf bs hc gb 80 xz\/u. Gur rzretrapl jurry vf abg n creznarag ercynprzrag. Vg znl bayl or qevira nf sne nf nofbyhgryl arprffnel.<\/c>";
		dbTblQ[1207].info = "<c>Pnef jvgu erne jurry qevir graq gb birefgrre, v.r., gur erne graqf gb ghea bhg gb gur fvqr vs gur zbgbevfg nppryrengrf gbb zhpu va n pheir.<\/c>";
		dbTblQ[1210].info = "<c>Na nagv-fyvc qrivpr (NFE) ceriragf gur jurryf sebz fcvaavat jura fgnegvat qhr gb gbb zhpu guebggyr. Rira jura fgnegvat bss ba n fyvccrel ebnq, zber fnsrgl vf bssrerq naq gur evfx bs oernxvat bhg fvqrjnlf vf erqhprq.<\/c>";
		dbTblQ[1212].info = "<c>N pbzcyrgr frg-hc bs gur uvgpu vf rffragvny gb rafher n fnsr pbaarpgvba orgjrra gur genvyre naq gur iruvpyr. Fhpu n pbaarpgvba pna or erpbtavmrq ol gur snpg gung gur onyy vf ratntrq va gur pbhcyre. Va nqqvgvba, na ryrpgevpny pbaarpgvba zhfg or rfgnoyvfurq. Gur fvtany ynzcf pna bayl shapgvba vs gur genvyre pnoyr vf cyhttrq va.<\/c>";
		dbTblQ[1213].info = "<c>Nsgre pbhcyvat, gur oernxnjnl ebcr zhfg or pbaarpgrq gb gur genvyre pbhcyvat fb gung vg eryrnfrf gur oenxr ba gur genvyre va gur rirag bs na rzretrapl. Gur shapgvba bs gur oenxr ba gur genvyre zhfg or purpxrq va beqre gb or noyr gb fnsryl cnegvpvcngr va ebnq genssvp. Gur wnpx jurry fubhyq or zbirq gb vgf hccrezbfg cbfvgvba.<\/c>";
		dbTblQ[1214].info = "<c>Sbe fnsr bcrengvba, gur crezvffvoyr fhccbeg ybnq zhfg abg or rkprrqrq. Gur fnzr nccyvrf gb gur crezvffvoyr nkyr ybnq. Gur crezvffvoyr gbgny znff bs gur genva zhfg or gnxra vagb nppbhag, naq rkprrqvat vg vf abg crezvggrq.<\/c>";
		dbTblQ[1215].info = "<c>Hfr gur cnexvat oenxr gb frpher gur genvyre ntnvafg ebyyvat njnl. Jurry pubpxf fubhyq or cynprq va sebag bs gur jurryf gb cebivqr nqqvgvbany cebgrpgvba.<\/c>";
		dbTblQ[1216].info = "<c>Vs vg vf abg hfrq sbe n ybatre crevbq bs gvzr, oenxrf bsgra graq gb orpbzr ehfgl, juvpu qenfgvpnyyl erqhprf gur oenxvat rssrpg. Pnoyr pbaarpgvbaf znl nyfb or qnzntrq, juvpu zrnaf gung gur genvyre yvtugf ab ybatre jbex.<\/c>";
		dbTblQ[1217].info = "<c>Bgure zbgbevfgf zhfg abg or raqnatrerq. Sbe guvf ernfba, gur pnetb zhfg nyjnlf or fgbjrq fnsryl. Vs gurer vf ab znexvat, gur ybnq zhfg abg rkgraq zber guna 1 z orlbaq gur ersyrpgbef.<\/c>";
		dbTblQ[1219].info = "<c>Gur ratvar cebivqrf n fhccbegvir oenxvat rssrpg jura qevivat qbjauvyy. Ubjrire, guvf vf bzvggrq jura gur pyhgpu vf chfurq. Nf n erfhyg, gur oenxrf unir gb or nccyvrq rira zber fgebatyl, juvpu vapernfrf gurve jrne.<\/c>";
