		dbTblQ[1366].info = "<c>Ba fyvccrel ebnqf, NOF rafherf gung gur jurryf qb abg ybpx qrfcvgr shyy oenxvat naq ner guhf oenxrq nf rssrpgviryl nf cbffvoyr. Rira jvgu rzretrapl oenxvat, vg vf ynetryl cbffvoyr gb pbagvahr gb fgrre gur iruvpyr.<\/c>";
		dbTblQ[1368].info = "<c>NOF ceriragf gur jurryf sebz ybpxvat qhevat oenxvat. Rira jvgu rzretrapl oenxvat, vg vf ynetryl cbffvoyr gb pbagvahr gb fgrre gur iruvpyr.<\/c>";
		dbTblQ[1369].info = "<c>Ba fyvccrel ebnqf, NOF rafherf gung gur jurryf qb abg ybpx naq guhf oenxvat pna bpphe va gur orfg cbffvoyr jnl. Rira jvgu rzretrapl oenxvat, vg vf ynetryl cbffvoyr gb pbagvahr gb fgrre gur iruvpyr.<\/c>";
		dbTblQ[1370].info = "<c>Vs gur gbjvat iruvpyr oenxrf, gur znff varegvn perngrf gur cbffvovyvgl gung gur genvyre znl pbyyvqr jvgu gur gbjvat iruvpyr. Jvgu guvf, gur genvyre jvyy fgneg gb oenxr, nyorvg fbzrjung qrynlrq.<\/c>";
