		dbTblQ[1474].info = "<c>Gur urnqynzcf sbe creznarag qvccrq urnqyvtugf fubhyq nyjnlf or ernql sbe bcrengvba. Gur fnzr tbrf sbe gur erne yvtug. Gur fnzr nccyvrf gb gur erne ersyrpgbe.<\/c>";
