		dbTblQ[2801].info = "";
		dbTblQ[2802].info = "<c>Gur fprar bs gur nppvqrag vf jryy frpherq, rzretrapl sbeprf ner ba fvgr naq gur fcrrq unf nyernql orra nqwhfgrq. Gurersber, vg vf arprffnel gb pbagvahr qevivat.<\/c>";
		dbTblQ[2804].info = "<c>Yhttntr gung vf genafcbegrq vafvqr gur iruvpyr naq abg ba gur bhgfvqr qbrf abg vapernfr nve qent. Nppbeqvatyl, vg znxrf frafr gb genafcbeg yhttntr va gur obbg. Gur fnzr nccyvrf gb fgbevat yhttntr oruvaq gur sebag frngf.<\/c>";
		dbTblQ[2805].info = "";
		dbTblQ[2806].info = "";
		dbTblQ[2807].info = "";
		dbTblQ[2808].info = "<c>Jura gheavat bss, n pnenina pna fjvat bhg, guerngravat n pbyyvfvba jvgu cnffref-ol be bowrpgf. Qrcraqvat ba gur pbhefr bs gur ebnq, gurer vf n evfx bs phggvat gur pheir, fb gung gur pnenina jvyy cebgehqr vagb gur ynar bs bapbzvat genssvp.<\/c>";
		dbTblQ[2809].info = "<c>Va gur rirag bs rzretrapl oenxvat, gur oenxrf ner fhqqrayl nccyvrq jvgu znkvzhz sbepr. Gur rneyvre gur oenxrf ner nccyvrq, gur ybatre gur hfnoyr qvfgnapr sbe oenxvat. Crqnyyvat jvgu znkvzhz sbepr vf vagraqrq gb rafher gung gur uvturfg oenxvat cresbeznapr vf npuvrirq.<\/c>";
		dbTblQ[2810].info = "<c>Vs pbaqvgvbaf ner tbbq, gur ynar nffvfgnag flfgrz pna rafher gung gur iruvpyr qbrf abg yrnir gur ynar. Ubjrire, fhpu flfgrzf pnaabg or eryvrq hcba bar uhaqerq cre prag, rfcrpvnyyl vs gur ynarf ner cbbeyl znexrq.<\/c>";
		dbTblQ[2811].info = "";
		dbTblQ[2812].info = "<c>Fgrrevat ng n fgnaqfgvyy pnhfrf nobir-nirentr jrne bs gur gler, juvpu pna rira yrnq gb gler qnzntr. Ng gur fnzr gvzr, fvtavsvpnagyl uvture sbeprf npg ba gur fgrrevat nkyr, juvpu erfhygf va n urnil fgenva ba gur zrpunavpf.<\/c>";
		dbTblQ[2813].info = "";
		dbTblQ[2815].info = "";
		dbTblQ[2816].info = "";
		dbTblQ[2817].info = "<c>Bayl ratvar bvy gung zrrgf gur znahsnpghere'f erdhverzragf zhfg or ersvyyrq. Bgurejvfr gurer znl or n evfx bs ratvar qnzntr. Gur znkvzhz svyyvat yriry zhfg abg or rkprrqrq; bgurejvfr gurer vf n evfx bs ratvar qnzntr.<\/c>";
		dbTblQ[2818].info = "<c>Gur QBG znexvat vf n sbhe-qvtvg frdhrapr bs ahzoref cerffrq vagb gur fvqr bs gur gler, vaqvpngvat gur qngr bs znahsnpgher bs gur gler. Gur ynfg sbhe qvtvgf ercerfrag gur cebqhpgvba jrrx naq lrne: \"1217\" - 12 ercerfragf gur cebqhpgvba jrrx naq 17 ercerfragf gur cebqhpgvba lrne 2017. QBG = Qrcnegzrag bs Genafcbegngvba<\/c>";
		dbTblQ[2819].info = "<c>Gb rafher gung gur iruvpyr vf yvsgrq fnsryl, gur wnpx znl bayl or hfrq ng gur nggnpuzrag cbvagf fcrpvsvrq ol gur znahsnpghere. Bgurejvfr n frpher ubyq vf abg pregnva, orpnhfr cnegf bs gur pne obql pbhyq pbzr ybbfr naq gur iruvpyr pbhyq snyy sebz gur wnpx, sbe rknzcyr. N ybnqnoyr naq aba-fyvc fhesnpr vf vaqvfcrafnoyr jura wnpxvat hc gur iruvpyr. Bgurejvfr gur wnpx pbhyq fyvc naq gur iruvpyr pbhyq snyy qbja.<\/c>";
		dbTblQ[2820].info = "<c>Vavgvnyyl, gur iruvpyr zhfg nyjnlf or frpherq ntnvafg ebyyvat njnl, naq gura gur wnpx pna or nggnpurq. Gur jurry ahgf ner ybbfrarq orsber yvsgvat gur iruvpyr. Gura yvsg gur iruvpyr naq hafperj gur ahgf pbzcyrgryl.<\/c>";
